import React, { useState } from 'react';
import Axios from 'axios';

function PostForm() {
    const url =""
    const [data, setData] = useState({
        title: "",
        POST: "",

    })
function submit(e) {
e.preventDefault();
Axios.post(url,{
    title: data.title,
    POST: data.POST,

})
.then(res=>{
    console.log(res.data)
})
}
    function handle(e){
        const newdata={...data}
        newdata[e.target.id] = e.target.value
        setData(newdata)
        console.log(newdata)

    }
    return (
        <div>
            <form onSubmit={(e)=> SubmitEvent(e)} >
            <input onChange={(e) => handle(e)} id="title" value ={data.title} placeholder="title" type="text"></input>
            <input onChange={(e) => handle(e)} id="POST" value ={data.POST} placeholder="POST" type="text"></input>
            <button>Submit</button>
            </form>
        </div>
    )
}
export default PostForm
